import React from "react";
import "./faq.css";
import Accordion from "./Accordion";
import { accordionData } from "./utils/content";

function Faq() {
  return (
    <div className="faq">
      {accordionData.map(({ title, content }) => (
        <Accordion title={title} content={content} />
      ))}
    </div>
  );
}

export default Faq;
